import React from 'react'

const Footer = () => {
    return (
        <div>
            <footer className="border-top footer text-muted text-center bg-light">
                <div className="container">
                    &copy; 2023 - BloodDonationApp.MVC
                </div>
            </footer>
        </div>
    )
}

export default Footer
